function pageReady(){var n="";for(let t in chatEnum)n+=`<option value="${chatEnum[t]}">${t}</option>`;$("#selectType").html(n);$("#btnSend").click(function(){var t,n,i,r;$("#text").val("");t=$("#selectType").val()>>0;switch(t){case chatEnum.Test:hubConnection.SendMsg(t,getFullTime(),n=>{$("#text").val(n)});break;case chatEnum.FaultDevice:for(n=[],n.push({Admin:"百盛光电",Code:"1号机"}),n.push({Admin:"百盛光电",Code:"2号机"}),i=0;i<n.length;i++)r=n[i],hubConnection.SendMsg(t,{Admin:r.Admin,Code:r.Code})}})}